import { useNavigate } from "react-router-dom";
import "../styles/room.css"

function Room(props){

    const navigate = useNavigate();

    function enterRoom(){
        navigate(`/room/${props.roomID}`)
    }

    return (
        <div id="room-container">
            <span>
                <p>{props.title}</p>
                <p>{props.npeople}</p>

            </span>

            <span>
                <p>{props.host}</p>
                <p>{props.language}</p>
            </span>
            
            <p>{props.description}</p>
            
            
            
            <img width="250" height="250" src={props.img} alt="Just an Imag"/>
            <div> </div>
            <div id="blur-1"> </div>
            <div id="blur-2"> </div>
            <div id="blur-3"> </div>
            <button onClick={enterRoom}>Join</button>
        </div>
    )
}

export default Room;
